CREATE TABLE `users` (`id` INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, `email` varchar DEFAULT '' NOT NULL, `encrypted_password` varchar DEFAULT '' NOT NULL, `reset_password_token` varchar, `reset_password_sent_at` datetime, `remember_created_at` datetime, `sign_in_count` integer DEFAULT 0 NOT NULL, `current_sign_in_at` datetime, `last_sign_in_at` datetime, `current_sign_in_ip` varchar, `last_sign_in_ip` varchar, `created_at` datetime, `updated_at` datetime, `admin` boolean, `default` false, `formation_id` integer);
